  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(name, email, password);
  };

  return (
    <form className={styles["signup-form"]}>
      <h2>Signup</h2>
      <label>
        <span>name:</span>
        <input
          type="text"
          onClick={(e) => setName(e.value.target)}
          value={name}
        />
      </label>
